　アディダスがプロアスリートのフィードバックをもとに研究・開発した高機能バックパックシリーズ「OPSシリーズ」。耐久性の高い1680Dポリエステル生地を採用した機動性に優れた薄型コンパクトバックパック。機動性に優れた薄型コンパクトバックパックにもかかわらず、収納力はバツグン。背面にはノートパソコンを収納できるPCコンパートメントを搭載し、外側・内側の収納ポケットも豊富。自転車での移動やタウンユースにも最適。<br>■カラー：BK(AP1995)、RD(AZ2381)、GR(AP1996)、PK(AZ2383)、GN(AZ2382)<br>■サイズ：28x49x15cm<br>■容量：20L<br>■素材：ポリエステル1680D、ポリエステル600D PUコーティング(ポリエステル)<br>■原産国：ベトナム<br>■機能：消臭・抗菌効果 デオドラントネーム、LOADSPRING(ロードスプリング)、climacool(クライマクール)<br><br><br>検索ワード：バック かばん 鞄 旅行 修学旅行 カジュアルバッグ リュックサック リュック  デイバッグ バッグ 通勤 通学<style TYPE="text/css">

