【フェイタス メディカル サポーター ひざ用 Lサイズの詳細】<br>
●競泳用の“高速水着”と同じ製法で作られた、「薄く、軽く、頑丈な」チタン合金配合素材「チタンガード」を採用。この「チタンガード」をひざの上下左右に使用することでひざ関節をしっかりと圧迫・保温し、ズレを抑え、ひざ関節のぐらつきを抑制します。<br>
●薄さ約0.6mmの通気性に優れた「超薄・伸縮素材」を、ひざの前面に採用。ひざ関節にフィットし、快適な動きやすさを実現。<br>
●ひざを少し曲げた角度で縫製した「屈曲デザイン」なので、曲げることの多いひざ関節にフィットし、曲げ伸ばしもスムーズです。<br><br>

【着用方法】<br>
1.「フェイタス」のタグが見えるように持ちます。<br>
2.製品を足に通します。靴下のようにたぐり寄せて、手の平でたくし上げるように履くと履きやすくなります。<br>
3.チタンガードが、正面のお皿の上下にくるように装着してください。<br>
4.たるみがでないようにしっかり伸ばしてください。<br><br>

【ご注意】<br>
○ねんざ、骨折、傷、湿疹などの異常や末梢血行障害のある人、化繊やゴム素材などにアレルギーのある人は使用しないでください。<br>
○ひざ以外の部位には使用しないでください。<br>
○サイズの合わないものは使用しないでください。<br>
○就寝中は使用しないでください。<br>
○痛み、かぶれ、傷、うっ血など身体に異常を感じた場合には直ちに使用を中止し、医師にご相談ください。<br>
○長時間の使用ならびに使用状況によって、破損や接着部のズレが生じた場合は、直ちに使用を中止してください。<br>
○機能のあらわれ方には個人差があります。<br>
○火の近くや高温になる場所には置かないでください。<br>
○製品の特性上、部分的に強い力が加わったり、爪などで引っ掛けると、引きつれたり、破れる恐れがありますのでご注意ください。<br>
○着用中、摩擦等により他のものに色移りすることがあります。<br>
○洗濯に際して、表示されている内容をご確認ください。<br>
○洗濯には中性洗剤をご使用ください。<br>
○洗濯中、色落ちすることがありますので、白または淡色物とは別に洗ってください。<br>
○アイロン、塩素系洗剤は使用しないでください。<br>
○タンブラー乾燥はお避けください。<br><br>

