【フェイタス メディカル サポーター 腰用 Lサイズの詳細】<br>
●背部はＷバックボーンと硬質素材により、面でサポート。また、側部にはＷサイドボーンを内蔵することにより、動きやすく、優れたサポート性を実現しました。<br>
●薄さ約0.6mmの通気性に優れた「超薄・伸縮素材」を2重で採用することにより、動きやすさ、しっかりとした圧迫力、心地よいフィット感を実現しました。<br>
●内側には２本のＷバックボーンに沿って「ズレ抑制加工」を施すことにより、上部へのズリ上がりを抑制します。<br>
●前面合わせ部分を少し下方向に下げたＶ字型にすることにより、腹部がしっかりと圧迫され、腹圧上昇により腰の負担軽減につながります。<br><br>

【着用方法】<br>
1.「フェイタス」のタグが内側の上になるように持ちます。<br>
2.サポーターを後ろにまわし、腰骨にかぶる高さに合わせて、左右均等の長さになるように引っ張ります。<br>
3.左側からしっかりと前に引き、右側を上に重ねて装着します。<br>
4.面ファスナーは前下がりになるように着け、たるみのないようにしっかり伸ばしてください。<br><br>

【ご注意】<br>
