○腰以外の部位には使用しないでください。<br>
○サイズの合わないものは使用しないでください。<br>
○サポーターの内側にカイロを入れて使用しないでください。<br>
○就寝中は使用しないでください。<br>
○痛み、かぶれ、傷、うっ血など身体に異常を感じた場合には直ちに使用を中止し、医師にご相談ください。<br>
○長時間の使用ならびに使用状況によって、破損や接着部のズレが生じた場合は、直ちに使用を中止してください。<br>
○肌の敏感な人は、下着の上から使用してください。<br>
